import React, { useEffect, useState } from 'react'

function Trading() {

    const [data, setdata] = useState(null)
    useEffect(() => {
        const fetchData = () => {
            fetch("https://api2.binance.com/api/v3/ticker/24hr")
                .then((response) => response.json())
                .then((data) => { setdata(data) });

        } }, [])
        console.log(data)

    return (
        <div>

        </div>
    )
}

export default Trading
